description:
Editor In Chief of Haute Couture Magazine Julia Ann is a ruthless, posh, and cruel woman who makes all her interns prove how badly they want to be part of the &quot;In&quot; crowd. Samantha (Ryan), one of the lucky girls to land the exclusive internship, will do anything to get ahead. Ruth (Zoe Britton), Samantha's main competition, sets out to use the naive Allie (Haze) to set Samantha up for a fall from grace. Little does Ruth know she has stepped on one too many toes, and interns Zoe (Voss) and Violet (Monroe) have it out for her. Who will &quot;break their heel and fall off the runway?&quot; Come and find out as we reveal a Fashion Industry tale of backstabbing, true love, and stilettos.

